from .. import loader, utils

import logging
import asyncio
from PIL import Image, ImageOps
from io import BytesIO
from base64 import b64decode as b64

logger = logging.getLogger(__name__)

@loader.tds
class CodefyMod(loader.Module):
    """Makes message monospace"""
    strings = {"name": "Keyboard typer"}

    @loader.ratelimit
    async def keyboardcmd(self, message):
        """.keyboard <text or reply>"""
        uinp = utils.get_args(message)
        if not uinp:
            get = await message.get_reply_message()
            if not get:
                uinp = '`1234567890-=\][poiuytrewqasdfghjkl;\'\n/.,mnbvcxz '
            else:
                uinp = get.raw_text
        else:
            uinp = " ".join(uinp)

        text = uinp.lower().strip()
        if len(text) == 0:
            text = '`1234567890-=\][poiuytrewqasdfghjkl;\'\n/.,mnbvcxz '
        await message.edit(' '.join([f'<code>{typing}</code>' for typing in 'Печатаю...']))
        keys = {'`': (38, 16), '~': (38, 16), 'ё': (38, 16), '1': (228, 16), '!': (228, 16), '2': (417, 16),
                '@': (417, 16), '3': (606, 16), '#': (606, 16), '№': (606, 16), '4': (795, 16), ';': (2094, 404),
                '$': (795, 16), '5': (984, 16), '%': (984, 16), '6': (1174, 16), '^': (1174, 16), ':': (2094, 404),
                '7': (1363, 16), '?': (2193, 603), '&': (1363, 16), '8': (1552, 16), '*': (1552, 16), '9': (1741, 16),
                '(': (1741, 16), '0': (1931, 16), ')': (1931, 16), '-': (2120, 16), '_': (263, 801), '=': (2309, 16),
                '+': (2309, 16), 'q': (331, 207), 'й': (331, 207), 'ц': (520, 207), 'w': (520, 207), 'e': (263, 801),
                'у': (710, 207), 'к': (899, 207), 'r': (263, 801), 't': (1088, 207), 'е': (1088, 207), 'н': (1277, 207),
                'y': (263, 801), 'u': (1466, 207), 'г': (1466, 207), 'ш': (1655, 207), 'i': (1655, 207),
                'o': (263, 801), 'щ': (1845, 207), 'з': (2034, 207), 'p': (2034, 207), '[': (2223, 207),
                '{': (2223, 207), 'х': (2223, 207), 'ъ': (2412, 207), '}': (2412, 207), ']': (2412, 207),
                '\\': (2606, 207), '|': (2606, 207), '/': (2193, 603), 'ф': (391, 404), 'a': (263, 801),
                's': (580, 404), 'ы': (580, 404), 'в': (770, 404), 'd': (263, 801), 'f': (959, 404), 'а': (959, 404),
                'п': (1148, 404), 'g': (1148, 404), 'h': (1337, 404), 'р': (1337, 404), 'о': (1526, 404),
                'j': (1526, 404), 'k': (263, 801), 'л': (1715, 404), 'д': (1905, 404), 'l': (1905, 404),
                'ж': (2094, 404), 'э': (2283, 404), "'": (2283, 404), '"': (2283, 404), '\n': (2472, 404),
                'я': (490, 603), 'z': (490, 603), 'x': (679, 603), 'ч': (679, 603), 'с': (869, 603), 'c': (869, 603),
                'v': (1058, 603), 'м': (1058, 603), 'и': (1247, 603), 'b': (263, 801), 'n': (263, 801),
                'т': (1436, 603), 'ь': (1625, 603), 'm': (1625, 603), 'б': (1814, 603), ',': (2193, 603),
                '<': (1814, 603), 'ю': (2004, 603), '>': (2004, 603), '.': (2193, 603), ' ': (720, 801)}
        keyboard_bytes = b''
        extra = {' ': 1230, '\\': 261, '|': 261, '/': 261, '\n': 393, 'no_on_keyboard': 218}

        keyboard = Image.open(BytesIO(b64(keyboard_bytes)))
        frames = []
        for bykva in text:
            temp = keyboard.copy()
            if bykva not in keys:
                bykva = 'no_on_keyboard'
            xp, yp = keys[bykva]
            length = 180
            if bykva in extra:
                length = extra[bykva]
            pressed = temp.crop((xp, yp, xp + length, yp + 180))
            pressed = ImageOps.invert(pressed)
            temp.paste(pressed, (xp, yp))
            frames.append(temp)
        output = BytesIO()
        output.name = "sub_to_@KeyZenD.gif"
        keyboard.save(output, "GIF", save_all=True, append_images=frames, duration=250)
        output.seek(0)
        await message.delete()
        await message.client.send_file(message.to_id, output)
